f it is proper to <span style=\"color: #169179;\"><strong><span style=\"text-decoration: line-through;\">say</span>(tell her)</strong></span>&nbsp;by myself or you could help me with this matter. I would rather hear what <span style=\"color: #169179;\"><strong><span style=\"text-decoration: line-through;\">it is your thoughs</span>(your thoughts are)</strong></span> instead of doing it. I would aprecciate <strong>YOU&nbsp;</strong> to help me.</p>',32,267,817,'2023-04-06 14:22:35','2023-04-10 14:28:23',NULL),
