(337,'{\"type\": \"embeddable\", \"embeddable\": \"Instructions: \\r\\n<Br>\\r\\n<Br>\\r\\n-Watch the video about organic food. Check the questions below for having a discussion with your teacher tomorrow.\\r\\n<Br>\\r\\n<Br>\\r\\n-State your definition of it according to the information you get from the video.\\r\\n<Br>\\r\\n<Br>\\r\\n-Discuss with your teacher why you consider it or not to be healthier than conventional food.\\r\\n<Br>\\r\\n<Br>\\r\\n-Present your position towards eating veggies and fruits more regularly. Why does it matter?\\r\\n<Br>\\r\\n<Br>\\r\\nWhat is your position before the statement that organic and conventional pesticides do not differe too much? \\r\\n<Br>\\r\\n<Br>\\r\\nWhat would be then the best products to consume? Organic or conventional? Why?\\r\\n\\r\\n\\r\\n<iframe width=\\\"853\\\" height=\\\"480\\\" src=\\\"https://www.youtube.com/embed/8PmM6SUn7Es\\\" title=\\\"Is Organic Really Better? Healthy Food or Trendy Scam?\\\" frameborder=\\\"0\\\" allow=\\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\\" allowfullscreen></iframe>\"}',101,1,1,'2023-04-04 00:19:01','2023-04-04 00:28:03'),
