(171,19,252,'When I was a child, my mom raised me with many restrictions. She was very strict with me because I was the oldest and I have to take care of my three siblings with only nine years old. After that, I grew up hating to be the oldest and I promised myself that I never get married nor I will not have babies. In my latest 20, I got married and three years later I was my only child. Of course, I changed completely my mind and my way to raise my daughter, although she was unique. I left my work because I wanted to spend time with her, such as playing together, getting her to school, to help her with her homework. I tried to support her in everything she needed. Nowadays, I feel proud of myself. I would have wanted that my mom to spend time with me but that never happened. I do not regret my decision because that was the best that I could do. Childhood never comes back.  I built many memories with my daughter and I am sure she will never forget them.  Sadly, I see at school children are careless and it will be a big problem in the next years when they turn into an adult without any love or support.',1,'2023-03-20 21:17:36','2023-03-19 23:57:37','2023-03-20 21:17:36'),
