(185,19,252,'Mary McLeod Bethune. I was impressed by how you can change the lives of others people around you. One month ago, I taught in my Social Sudy class about this amazing woman named Mary McLeod Bethune. She was a daughter of former enslave parents but she had very clear objectives. Mary became the most important black educator in the 90s when she opened her own school in Florida called Literacy and Industrial School for Training Negro Girls. Later, her school became a college. Also, Bethune fought for civil and womans rights and she obtained an important role as an advisor during the government of President Franklin Delano Roosevelt. Currently, I love her because she never gave up, although she did have enough resources for teaching. For example, she used to use boxes as school desks and she went to the forest to pick sticks and then she burned them for having charcoal in the border for writing. Nowadays, my student has a computer for their assignments and they did not value that. Actually, this week I put new pencils on their school desks and at the end of the week some of them were broken. I advise them: to value their resources and use them properly because they do not know if you will have them forever. I do not know to want to imagine how will be their life in the future.',1,'2023-03-27 21:15:36','2023-03-25 23:20:49','2023-03-27 21:15:36'),
(186,19,252,'Many centuries ago, many people have considered that Evolution theory is a fact. They are convinced life arose spontaneously from no living matter but they have never shown the missing link and they will never find it because this simply does not exist. Currently, everyone can have their own Bible and can take their time to read it. There, they can find the answer when God created all kinds of life that you can see in our times. He has the power for doing that because he is the Almighty. Scientists have tried to recreate in the laboratory the environmental condition that they believe existed early in the earths history. Sadly, they did not obtain the expected results. Bible says: With you is the source of life; my life we can see light. I believe that I was created by God. I am convinced that in the future, people and especially scientists have to recognize that evolution is only one more theory.',1,'2023-03-27 21:15:36','2023-03-26 00:09:41','2023-03-27 21:15:36'),
