(217,19,252,'I think it is absolutely hard for someone who used to be late to change his behavior. For instance, if someone shows up late to have a meeting at 8:00 AM. That person might be late if you move the meeting to 8:30 AM, he will continue being late. That person needs to be convinced that he needs to change. I mean, he needs a big effort for making changes in his mind but, it will be step by step. He might not achieve his goal overnight. One day, he can do an amazing job but the next day, he might not do a great job, at the first. However, if he tries many times, he will create a habit and it will contribute to major changes in his life, and finally, that person will arrive at the end of his procrastination.',1,'2023-04-24 19:49:25','2023-04-18 22:02:43','2023-04-24 19:49:25'),
