(236,19,252,'Taking in consideration the previous article, the end of humans might depend of themselves, it can be hard because everyone used to be comfortable and every day new products are creating for satisficing our demands and needs, but it might damage our planet. For that reason, we could ask before create something: Will it be useful and environment friendly? Sadly, most of people only think about them earnings. One good way to do it, it could be recycling, but it requires hard work and our capitalist and consumerist society just think about take and throw away. Actually, I feel guilty because in this country, people drink water from bottle and I do the same and thinking very well about that I generate many pounds of plastics every day too. Finally, I would like to cite from the past article: In the absence of a fully secure evolutionary shield, we could depend on our intelligence to survive. Nevertheless, as Abraham Loeb, professor of science at Harvard University and an astronomer who is searching for dead cosmic civilizations puts it, \"the mark of intelligence is the ability to promote a better future\". \"If we continue to behave this way, we might not survive very long,\" he says. \"On the other hand, our actions could be a source of pride for our descendants if they sustain a civilization intelligent enough to endure for many centuries to come.\"',1,'2023-04-24 21:49:28','2023-04-24 21:42:28','2023-04-24 21:49:28'),
