insert  into `products`(`id`,`name`,`slug`,`description`,`regular_price`,`sale_price`,`image`,`status`,`created_at`,`updated_at`) values 
(1,'English Regular Program','english-regular-program','Experience English in a captivating way with our program, designed to align with the esteemed Common European Framework of Reference for Languages. Immerse yourself in authentic situations and practical learning encounters, where you\'ll engage with fellow learners and native speakers, fostering interactive and meaningful communication.\r\n\r\nGet ready for an appealing journey of functional language acquisition!',19.99,14.99,'public/images/products/covers/English_Regular_Program.jpeg',1,NULL,'2023-06-20 04:52:38'),
(5,'English Pronunciation Course','english-pronunciation-course','English Pronunciation Course',180.00,149.95,'public/images/products/covers/English_Pronunciation_Course.jpeg',1,NULL,'2023-02-01 15:11:15'),
(6,'Basic English Grammar Course','basic-english-grammar-course','Basic English Grammar Course',250.00,199.95,'public/images/products/covers/Basic_English_Grammar_Course.jpeg',1,NULL,'2023-02-01 15:11:28'),
(7,'Enrolment','enrolment','Unlock your educational journey with a single, all-inclusive payment to kickstart any of our outstanding study programs. Take the first step towards your academic goals with a hassle-free, upfront payment requirement. Start your learning adventure today!',20.00,15.00,'public/images/products/covers/enrolment.jpg',0,NULL,'2023-06-19 20:13:28'),
(14,'English Regular Program (Old)','english-regular-program-old','Experience English in a captivating way with our program, designed to align with the esteemed Common European Framework of Reference for Languages. Immerse yourself in authentic situations and practical learning encounters, where you\'ll engage with fellow learners and native speakers, fostering interactive and meaningful communication. Get ready for an appealing journey of functional language acquisition!',15.00,9.99,'public/images/products/covers/english-regular-program-old.jpeg',1,NULL,'2023-06-19 20:10:38'),
(15,'English Conversational Program (Old)','english-conversational-program-old','Immerse yourself in a world of personalized learning with our classes tailored to meet the specific needs of each student, focusing on the development of their communication skills. In addition to regular lessons, this package offers a range of conversational practices where students engage with fellow learners and native speakers. Experience a truly customized environment that nurtures your language abilities and provides ample opportunities for interactive growth.',20.00,14.99,'public/images/products/covers/english-conversational-program-old.jpeg',1,NULL,'2023-06-19 20:14:32'),
(16,'Spanish Regular Program','spanish-regular-program','Embark on a dynamic online Spanish program that adheres to the standards of the European Framework of Reference. Our program aims to empower learners in effective communication and skill development through immersive and purposeful learning experiences. Explore a curriculum designed to engage students with authentic contexts, utilizing tasks and interactive encounters with fellow learners and native speakers. Join us for a transformative language journey where every lesson is a meaningful step toward proficiency and fluency.',19.99,NULL,'public/images/products/covers/spanish-regular-program.jpeg',1,NULL,'2023-06-19 20:16:16'),
(17,'Spanish Conversational Program','spanish-conversational-program','Immerse yourself in a world of personalized learning with our classes tailored to meet the specific needs of each student, focusing on the development of their communication skills. In addition to regular lessons, this package offers a range of conversational practices where students engage with fellow learners and native speakers. Experience a truly customized environment that nurtures your language abilities and provides ample opportunities for interactive growth.',24.99,NULL,'public/images/products/covers/Spanish_Conversational_Program.jpeg',1,NULL,'2023-06-20 04:50:34'),
(27,'Lingowow T-shirt','lingowow-t-shirt-2','T-shirt',1.00,NULL,'images/image_preview.png',0,'2023-01-31 23:35:40','2023-06-17 19:53:13'),
(29,'English Conversational Program','english-conversational-program','Immerse yourself in a world of personalized learning with our classes tailored to meet the specific needs of each student, focusing on the development of their communication skills. In addition to regular lessons, this package offers a range of conversational practices where students engage with fellow learners and native speakers. Experience a truly customized environment that nurtures your language abilities and provides ample opportunities for interactive growth.',19.99,NULL,'public/images/products/covers/English_Conversational_Program.jpeg',1,'2023-02-01 04:13:26','2023-06-19 20:14:51'),
(30,'Spanish Regular Program (Old)','spanish-regular-program-old','Embark on a dynamic online Spanish program that adheres to the standards of the European Framework of Reference. Our program aims to empower learners in effective communication and skill development through immersive and purposeful learning experiences. Explore a curriculum designed to engage students with authentic contexts, utilizing tasks and interactive encounters with fellow learners and native speakers. Join us for a transformative language journey where every lesson is a meaningful step toward proficiency and fluency.',19.99,14.99,'public/images/products/covers/spanish-regular-program-old.jpeg',1,'2023-02-06 16:20:17','2023-06-19 20:16:02'),
(31,'Placement Test','placement-test','Embark on an enlightening assessment journey with our exam designed to classify students into their corresponding levels according to the Common European Framework of Reference (CEFR). Enjoy the following benefits:\r\n\r\n- A single opportunity to take the Classification Exam.\r\n- Temporary access to a personalized user account.\r\n\r\nExperience the power of accurate placement and unleash your language potential!',40.00,30.00,'public/images/products/covers/placement-test.png',1,'2023-03-08 05:04:21','2023-06-19 20:12:19');
